            MeshPart ret = new MeshPart("");
            ret.Indices = new IndexBuffer(siat.GraphicsDevice, indicesSizeInBytes, BufferUsage.WriteOnly, IndexElementSize.ThirtyTwoBits);
            int[] array = new int[aMeshContent.Geometry[0].Indices.Count];
            aMeshContent.Geometry[0].Indices.CopyTo(array, 0);
            ret.Indices.SetData<int>(array);
            ret.AABB = BoundingBox.CreateFromPoints(aMeshContent.Positions);
            ret.BoundingSphere = BoundingSphere.CreateFromPoints(aMeshContent.Positions);
            ret.PrimitiveCount = aMeshContent.Geometry[0].Indices.Count / 3;
            ret.PrimitiveType = PrimitiveType.TriangleList;
            ret.Vertices = new VertexBuffer(siat.GraphicsDevice, verticesSizeInBytes, BufferUsage.WriteOnly);
            ret.Vertices.SetData<byte>(vb.VertexData);
            ret.VertexCount = aMeshContent.Geometry[0].Vertices.VertexCount;
            ret.VertexDeclaration = declaration;
            Debug.Assert(vb.VertexData.Length % aMeshContent.Geometry[0].Vertices.VertexCount == 0);
            ret.VertexStride = vb.VertexData.Length / aMeshContent.Geometry[0].Vertices.VertexCount;

            return ret;
        }

        private static void _Assign(MeshPartNode aMeshPart)
        {
            Siat siat = Siat.Singleton;

            int indexCount = kSphereIndices.Length;
            int posCount = kSpherePositions.Length;

            Random r = new Random();

            float diff = (1.0f - SpatialMin);
            float diffuseDiff = (1.0f - DiffuseMin);

            float scale = ((float)r.NextDouble() * diff) + SpatialMin;

            MeshBuilder builder = MeshBuilder.StartMesh("");
            Vector3[] positions = new Vector3[posCount / 3];

            for (int i = 0; i < posCount; i += 3)
            {
                Vector3 pos = new Vector3(
                    kSpherePositions[i + 0],
                    kSpherePositions[i + 1],
                    kSpherePositions[i + 2]);

                float ran = (float)r.NextDouble();
                float ran2 = (ran * diff) + SpatialMin + (0.5f * diff);

                scale *= ran2;
                pos *= scale;

                builder.CreatePosition(pos);
                positions[i / 3] = pos;
            }

            int colorIndex = builder.CreateVertexChannel<Vector4>(VertexChannelNames.EncodeName(VertexElementUsage.Color, 0));

            float min = float.MaxValue;
            float max = float.MinValue;
            Vector4[] colors = new Vector4[indexCount];

            for (int i = 0; i < indexCount; i++)
            {
                float diffuse = Math.Abs(_Noise(
                    positions[kSphereIndices[i]].X,
                    positions[kSphereIndices[i]].Y,
                    positions[kSphereIndices[i]].Z));

                diffuse *= Math.Abs(_Noise(
                    positions[kSphereIndices[i]].X * 0.10f,
                    positions[kSphereIndices[i]].Y * 0.10f,
                    positions[kSphereIndices[i]].Z * 0.10f));

                min = Utilities.Min(min, diffuse);
                max = Utilities.Max(max, diffuse);

                Vector4 color = new Vector4(diffuse, diffuse, diffuse, 1.0f);
                colors[i] = color;
            }

            float shift = DiffuseMin - min;
            float adj = 1.0f / (max + shift);

            for (int i = 0; i < indexCount; i++)
            {
                Vector4 color = new Vector4(
                    colors[i].X + shift,
                    colors[i].Y + shift,
                    colors[i].Z + shift, 1.0f);
                color *= adj;

                builder.SetVertexChannelData(colorIndex, color);
                builder.AddTriangleVertex(kSphereIndices[i]);
            }

            MeshContent mesh = builder.FinishMesh();
            MeshHelper.CalculateNormals(mesh, true);
            MeshHelper.OptimizeForCache(mesh);

            aMeshPart.MeshPart = _FromMeshContent(mesh);
        }

        private static void _Populate(MeshPartNode aMeshPart)
        {
            Siat siat = Siat.Singleton;

            CompilerMacro[] macros = new CompilerMacro[1];
            macros[0] = PipelineUtilities.NewMacro(kDiffuseMacro, "1");

            CompiledEffect ce = Effect.CompileEffectFromFile(ColladaProcessor.kStandardEffectFile, macros, null, CompilerOptions.None, TargetPlatform.Windows);
            if (!ce.Success) { throw new Exception(); }
            SiatEffect effect = new SiatEffect("diffuse_only", new Effect(siat.GraphicsDevice, ce.GetEffectCode(), CompilerOptions.None, null));

            aMeshPart.Effect = effect;
            aMeshPart.MeshPart = siat.UnitSphereMeshPart;
        }

        private static void _OnLoad()
        {
            Siat siat = Siat.Singleton;

            Model = new MeshPartNode();
            _Populate(Model);
            Poser = new SceneNodePoser(Model);

            Camera = new CameraNode(null);
            Camera.ProjectionTransform = Matrix.CreatePerspectiveFieldOfView(MathHelper.PiOver2, 800.0f / 600.0f, 0.1f, 1000.0f);
            Camera.bActive = true;
            Camera.WorldPosition = Vector3.Backward * 1.5f;

            Light = new LightNode();
            Light.Parent = Model;
            Light.Light.LightDiffuse = Color.White.ToVector3();
            Light.Light.Type = LightType.Directional;
            Light.WorldOrientation = Quaternion.CreateFromAxisAngle(Vector3.Up, MathHelper.PiOver4) *
                Quaternion.CreateFromAxisAngle(Vector3.Left, MathHelper.PiOver4);
        }

        private static void _OnDraw()
        {
            Poser.StartPose();
        }

        private static float mElapsed = 0.0f;
        private static float mAngle = 0.0f;

        private static void _OnPreUpdate()
        {
            mElapsed += (float)Siat.Singleton.Time.ElapsedGameTime.TotalSeconds;

            if (mElapsed > 5.0f)
            {
                mElapsed = 0.0f;
                _Assign(Model);
            }

            //mAngle += 0.01f;
            if (mAngle > MathHelper.TwoPi) { mAngle = 0.0f; }

            Model.Update(null, ref Utilities.kIdentity, false);

            float dist = Model.WorldBounding.Radius * 2.0f;
            Matrix ori = Matrix.CreateFromAxisAngle(Vector3.Up, mAngle);

            Light.WorldTransform = ori;
            Light.WorldPosition = Vector3.TransformNormal(Vector3.Backward, ori) * dist;

            Camera.WorldPosition = Vector3.Backward * dist;

            Camera.Update(null, ref Utilities.kIdentity, false);

            Siat.Singleton.AddConsoleLine("Spatial Min: " + SpatialMin.ToString());
            Siat.Singleton.AddConsoleLine("Diffuse Min: " + DiffuseMin.ToString());
        }

        private static void _OnKeyHandler(KeyState aState, Keys aKey)
        {
            if (aState == KeyState.Up)
            {
                if (aKey == Keys.Escape) { Siat.Singleton.Exit(); }
            }
            else
            {
                if (aKey == Keys.W) { SpatialMin += 0.01f; }
                if (aKey == Keys.S) { SpatialMin -= 0.01f; }
                if (aKey == Keys.Up) { DiffuseMin += 0.1f; }
                if (aKey == Keys.Down) { DiffuseMin -= 0.1f; }
            }
        }

        private static void _OnPostUpdate()
        {
        }

        public static void Go()
        {
            Siat siat = Siat.Singleton;
            Input input = Input.Singleton;

            input.AddKeyCallback(Keys.Escape, _OnKeyHandler);
            input.AddKeyCallback(Keys.W, _OnKeyHandler);
            input.AddKeyCallback(Keys.S, _OnKeyHandler);
            input.AddKeyCallback(Keys.Up, _OnKeyHandler);
            input.AddKeyCallback(Keys.Down, _OnKeyHandler);
            siat.OnDrawBegin += _OnDraw;
            siat.OnLoading += _OnLoad;
            siat.OnUpdateBegin += _OnPreUpdate;
            siat.OnUpdateEnd += _OnPostUpdate;
            RenderRoot.ClearColor = Color.Black;

            siat.Run();
        }

        public static void Main(string[] aArgs)
        {
#if !DEBUG || CLIENT_USAGE
            try
            {
#endif
            Go();
            #if !DEBUG || CLIENT_USAGE
            }
            catch (Exception e)
            {
                string caption = "Exception: Please send \"" + kLogFile + "\" to the appropriate parties.";
                string msg = "Exception: \"" + e.Message + "\"" + System.Environment.NewLine;
                msg += "Source: \"" + e.Source + "\"" + System.Environment.NewLine;
                msg += "Target site: \"" + e.TargetSite + "\"" + System.Environment.NewLine;
                msg += "Stack trace:" + System.Environment.NewLine + e.StackTrace;

                using (System.IO.StreamWriter errorWriter = new StreamWriter(kLogFile))
                {
                    errorWriter.Write(msg);
                }

                System.Windows.Forms.MessageBox.Show(msg, caption, 
                    System.Windows.Forms.MessageBoxButtons.OK, 
                    System.Windows.Forms.MessageBoxIcon.Error);
            }
#endif
            }
    }
